  false,\n\t\"url\": null,\n\t\"notes\": \"A natural or man-made flow (or sediment)
  control structure in a water course or water body such as a dike or weir. This feature
  should not be used to model a levee. GIS database of the wing dam/closing dam attributes
  for those structures constructed along the nine-foot navigation channel of the Mississippi
  River (river miles 840.1 to 615.2). Wing dams are rock and brush structures extending
  from the bank toward the navigation channel to concentrate flow in the navigation
  channel. Closing dams are rock and brush structures extending across secondary channels
  to concentrate flow in the main channel. Many closing dams are located at the upriver
  entrance to secondary channels, while others are located farther downriver within
  secondary channels.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
